Last one I promise @latinamericanfashionsummit 🧡 (so much on my camera roll I haven’t had time to post). Little moments in Santo Domingo that made us smile, like that time @glasswingi invited us to paint a school 🎨 where @marinesduarte @amandadudamel and I unleashed our inner Picasso’s☝🏼… but also if you’re at LAFS and can’t find me it’s because I’m backstage listening to some of my favorite panelists - I won’t spill on the lineup for November but I’ll just tell you it’s beyond what you expect 🫢. The week ended on such a high note, literally a note from @tommyhilfiger and an Oxford shirt with my initials on it 🥲🫶🏼 

